import React from 'react'
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <div className="top-nav">
            <div className="links">
                <Link to="/shop"/>
                <Link to="/contact"/>
                <Link to="/sign-in"/>
                <Link to="/cart"/>
            </div>
        </div>
    )
}
export default Header;
